-- ----------------------------
-- Table structure for member
-- ----------------------------
DROP TABLE IF EXISTS `member`;
CREATE TABLE `member`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `username` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名',
  `password` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `nickname` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '昵称/团队名称',
  `name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '姓名/负责人姓名',
  `charge_phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '负责人联系方式',
  `phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '手机',
  `type` int(5) NOT NULL DEFAULT 1 COMMENT '类型（1个人用户，2团队用户）',
  `card_type` int(5) NULL DEFAULT 0 COMMENT '卡类型(0 身份证)',
  `id_card` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '证件编码/负责人身份证',
  `native_place` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '籍贯',
  `address` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '地址',
  `education` int(5) NULL DEFAULT NULL COMMENT '学历 1本科及以上2大专3中专4高中5小学',
  `birthday` date NULL DEFAULT NULL COMMENT '出生日期',
  `sex` int(5) NULL DEFAULT NULL COMMENT '性别0男1女',
  `head_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像',
  `science_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '资质材料',
  `real_verify` int(5) NOT NULL DEFAULT 0 COMMENT '是否实名认证(0未实名1已实名)',
  `source` int(5) NULL DEFAULT 0 COMMENT '注册来源1 web,2 admin,3 android,4 ios,5 mini',
  `unionid` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信用户唯一标识',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间/提交时间',
  `authentication_time` datetime(0) NULL DEFAULT NULL COMMENT '认证时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `last_login_time` datetime(0) NULL DEFAULT NULL COMMENT '最近登陆时间',
  `create_by` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '创建人',
  `update_by` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '更新人/审核人',
  `audit_by` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核人',
  `audit_time` datetime(0) NULL DEFAULT NULL COMMENT '审核时间',
  `audit_status` int(1) UNSIGNED NULL DEFAULT NULL COMMENT '审核状态 1待审核，2 已审核，3审核不通过 ',
  `audit_desc` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核意见',
  `team_type` int(5) NULL DEFAULT NULL COMMENT '团队类型 1艺术团队2其它',
  `enable` int(5) NULL DEFAULT 1 COMMENT '1:有效,0:无效 本期不可配置，默认全部有效，后续业务扩展用',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UNI_PHONE_TYPE`(`phone`, `type`) USING BTREE,
  UNIQUE INDEX `UNI_USERNAME`(`username`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 133 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员信息' ROW_FORMAT = Compact;

